import React,{Component} from 'react';
import './Separador.css';

class Separador extends Component{
    constructor(props){
        super(props);
        this.state={
            text: props.text,
            h1:{
                heigth: undefined,
                width: undefined
            }
        }
    }

    render(){

        let titulo = <h1>{this.state.text}</h1>

        return (
            <div className="separador">
                <svg width="150px" heigth="49px" viewBox="0 0 150 49">
                    <path d="M150 25 L0 25" stroke="gray"></path>
                </svg>
                {titulo}
                <svg width="150px" heigth="49px" viewBox="0 0 150 49">
                    <path d="M0 25 L150 25" stroke="gray"></path>
                </svg>
            </div>
        );
    }
}

export default Separador;
